import { useState } from "react";
import { useLocation } from "react-router-dom";
import { Footer } from "../components/Footer";
import { Header } from "../components/Header";
import { MainBody } from "../components/MainBody";
import { HomeSub } from "../components/subScreens/HomeSub";
import { CategoryFilters, FiltersList } from "../locales/filters";
import { Filter } from "../models/Filter";
import { Food } from "../models/Food";
import data from "../store/data";
import { FoodData } from "../testData/FoodData";

export const HomeScr = () => {
  const { state } = useLocation();
  const [food, setFood] = useState<Food[]>(FoodData);
  const [cart, setCart] = useState<Food[]>(state ? state.item : []);
  const [popup, setPopup] = useState({});
  return (
    <MainBody>
      <HomeSub
        cart={cart}
        setCart={setCart}
        popup={popup}
        setPopup={setPopup}
        food={food}
      />
    </MainBody>
  );
};
